public static int WriteDelta<T>(T prev, T cur) where T : unmanaged
    {
        //выделяем в стеке память под 2 структуры
        var p_ptr = stackalloc [] {prev};
        var c_ptr = stackalloc [] {cur};

        //создаём массив размером со структуру
        byte[] p1 = new byte[sizeof(T)];
        byte[] p2 = new byte[sizeof(T)];

        //назначаем указатели
        fixed(byte* d1 = &p1[0])
        {
            *(T*)d1 = *p_ptr;
        }

        fixed(byte* d2 = &p2[0])
        {
            *(T*)d2 = *c_ptr;
        }

        //ищем различия между структурами по байтам
        var changes = 0;
        for(int i = 0; i < sizeof(T);i++)
        {
            if(p1[i] != p2[i]){changes++;}
        }

        //возвращаем число изменений между двумя структурами
        return changes;
    }
